// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import Page1 from './Page1';

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
            </li>
            {/* Add more links for other pages */}
          </ul>
        </nav>

        <Switch>
          <Route exact path="/" component={Page1} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
